import React, { Component } from "react";
import { getMovies } from "../services/fakeMovieService";

export default class Movies extends Component {
  state = {
    movies: getMovies(),
  };

  render() {
    return (
      <div>
        {this.state.movies.map((movie) => {
          return (
            <table>
              <label>Title</label>
              <tr>{movie.title}</tr>
              <label>Genre</label>
              <tr>{movie.title}</tr>
              <label>Title</label>
              <tr>{movie.title}</tr>
              <label>Title</label>
              <tr>{movie.title}</tr>
            </table>
          );
        })}
      </div>
    );
  }
}
